the annual reports provide information about instances of sexual misconduct, dating and domestic violence, stalking, and certain forms of retaliation that were reported to the title ix and gender equity office during the applicable fiscal year (july 1 to june 30). for some years, the annual reports also include information on reports of sexual harassment and other forms of sex- and gender-based discrimination and harassment that were made to the title ix and gender equity office. the annual reports also include data on the number of investigations initiated during each academic year, as well as aggregated data on outcomes for every formal and informal resolution that were resolved within that same timeframe.the purpose of publishing the annual reports is to promote transparency (within the constraints of confidentiality), raise awareness, and promote productive community dialogue. please email the title ix and gender equity office attitleix@sjsu.eduif you have any queestions about the annual report.please email the title ix and gender equity office attitleix@sjsu.eduif you have questions regarding the information in the annual reports.interim title ix and gender equity officerphone:408-924-7290(m-f, 8am-5pm)669-877-0620(after hours, voice/text)email:titleix@sjsu.educlark hall 1st floorroom 126one washington squaresan jos, ca 95192-0126